      <tr>
        { dateRow.map((date) => <td>{date}<a className="btn square igreen" onClick={this.delete}>x</a></td> ) }
      </tr>
    );

    const tableFields = this.props.fields.map((field) =>
      <th>{field}</th>
    );
    return (
      <div className="tableArt">
        <table>
	      <thead>
	      <tr>
	      	{tableFields}
	      </tr>
	      </thead>
	      <tbody>
	        {tableDates}
	      </tbody>
        </table>
      </div>
    );
  }
}

export default TableArt;
